import React from 'react';
import Logo from '../../assets/img/Logo.png'
import './menu.css'
import ButtonLink from '../ButtonLink';

function Menu(){
    return(
        <nav className="Menu">
            <a href="/">
                <img class="Logo" src={Logo} alt="Pedrinhoflix Logo"/>
            </a>

            <ButtonLink className="ButtonLink" href="/">
                Novo Video
            </ButtonLink>
        </nav>
    );
}

export default Menu;
